package switchCase;

public class OnetoFive {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int number=0;  
		
		
	    //Switch expression  
	    switch(number){  
	    //Case statements  
	    case 0: System.out.println("1,2,3,4,5");  
	    break;  
	     
	    default:System.out.println("Not in 1 to 5");  
	    }  
	} 

	}


